import React from "react";
import ReactDOM from "react-dom";
import "./index.css";
import Want from "./Mep";

function My(){
  let a=10;
  let name=" ";
  if(a==10){
    name="its me";

  }
  else{
    name="no its not me";
  }

  return (
   <h1>{name}</h1>
  )
}


ReactDOM.render(
   
   <div>
   <Want />
   <My />
   <h1>hey broh whats up</h1>
   </div>
   
 ,document.getElementById("root"));
